) RETURNS text CHARSET utf8 COLLATE utf8_unicode_ci
    SQL SECURITY INVOKER
begin

	
    declare v_str text;
	declare v_cl varchar(100);
	
	drop temporary table if exists tmp_cltbl;
	create temporary table tmp_cltbl (
		cl varchar(100)
	);

    insert into tmp_cltbl (cl)
    select contentlevel 
	  from aa_itemcl 
