	v_testpackagekey varchar(350)
)
begin
	
	
	
	
	insert into tblstrand (_fk_subject, `name`, _fk_parent, _key, _fk_client, treelevel, loadconfig) 
	select distinct subjectkey
		 , bpelementname
		 , case when parentid is null or parentid = '' 
				then null 
				else parentid 
		   end
		 , bpelementid
		 , clientkey
		 , treelevel
		 , version
